import React from "react";
import { Route, Routes } from "react-router-dom";
import PlayerList from "./Components/Player/PlayerList";

function AppLinks() {
  return (
    <div>
      <Routes>
        <Route path="/" element={<PlayerList />}>
          Home
        </Route>
      </Routes>
    </div>
  );
}

export default AppLinks;
